import React from 'react';

const Footer = () => {
  return (
    <div className="footer">
      <div className="content-list">
        <div className="content">
          <h4>Contact</h4>
          <h6>Email: </h6>
          <h6>Phone No: </h6>
          <h6>Location: </h6>
        </div>
      </div>
    </div>
  );
};

export default Footer;
